import colorsData from '../../data/colors';
import { DataGrid } from '@material-ui/data-grid';
import Button from '@material-ui/core/Button';


export default function FoodDeliveryHome() {

  const colors = colorsData.colors;
  console.log(colors);

  const columns = [
    { field: 'id', headerName: 'ID', width: 200 },
    { field: 'color', headerName: 'Colors', width: 200 }
  ];

  const addColor = () => {
    const newColors = this.colors;
    const newobject = { "id": 1, "color": "newcolor"};
    newColors.push(newobject);
    //colors = newColors;
    console.log(newColors);
    console.log(colors);


  };


  return (
  <React.Fragment>
    Test Component 1
    <div style={{ height: 750, width: '100%' }}>
    <Button variant="contained" color="primary" onClick={addColor}>
        Add Color
    </Button>
    <DataGrid 
        rows={colorsData} 
        columns={columns} 
      />
    </div>
  </React.Fragment>
  );
}
